import React from 'react';

function Compte(props){
	const c = 
		{
			prenom:"Nasser",
            nom:"Nourou",
            photo:"",
            displayName:"Nasser Nourou",
            username:"nan0u_b1nks",
			dateCreation:"le 3 janvier 2022",
			points:2352,
			status:"Morphologie de type B majuscule",
			resaux:[
				{
					nom:"Instagram",
                    identifiant:"@nanou-B1nks",
					url:"200 €"
				},
				{
					nom:"Tweeter",
                    identifiant:"@nanou-B1nks",
					url:"Boutique physique et en ligne"
				},
				{
					nom:"Snapchat",
                    identifiant:"@nanou-B1nks",
					url:"Soumettre sa tenu avant la date de fin"
				},
				{
					nom:"TikTok",
                    identifiant:"@nanou-B1nks",
					url:"Soumettre sa tenu avant la date de fin"
				},

			],
            proprietaire:true,
		}
    
	const compte = (
		<div className='w-100 h-100'>
			{
				(c.proprietaire===true) ?
                <div className="compte">
                    <img src="" alt="" className="comptePhoto" />
                    <h4 className="compteName">
                        {c.displayName}
                    </h4>
                    <h6 className="compteUsername">
                        @{c.userName}
                    </h6>
                    <span className="comptePoint">
                        {c.points}
                    </span>
                    <p className="compteStatut">
                        {c.status}
                    </p>
                    <ul className="compteReseaux">
                        {c.resaux.map(r => 
                        <li className="w-100">
                            <a href={r.url} className="w-100 compteLink">
                                <span>{r.nom}</span>
                                <span className='fw-bold'> {r.identifiant}</span>
                            </a>
                        </li>	
                        )}
                    </ul>

                </div>
				:
                <div className="compte">
                    <img src={c.photo} alt="" className="comptePhoto" />
                    <h4 className="compteName">
                        {c.displayName}
                    </h4>
                    <h6 className="compteUsername">
                        @{c.userName}
                    </h6>
                    <span className="comptePoint">
                        {c.points}
                    </span>
                    <p className="compteStatut">
                        {c.status}
                    </p>
                    <ul className="compteReseaux">
                        {c.reseaux.map(r => 
                        <li className="w-100">
                            <a href={r.url} className="w-100 compteLink">
                                <span>{r.nom}</span>
                                <span className='fw-bold'> {r.identifiant}</span>
                            </a>
                        </li>	
                        )}
                    </ul>

                </div>
			}
		</div>
	)

    return (
		<div className=" d-flex justify-content-center align-items-center ">
			{compte}
		</div>  
    );
}
export default Compte;
